import React, {useState} from 'react';

class SignUp extends React.Component{

    constructor(props){
        super(props);
        this.state = {
            name:"user",
            form:this.welcome
        };
    }




    render(){
        return(
            <div className="SignUp" >
            {this.state.form}
            </div>
        )

    }
}

export default SignUp;
